    function calcNB() {
        var review = document.getElementById("review").value
        review = review.replace(/[\.,-\/#!$%\^&\*;:{}=\-_`~()]/g,"")

        var bagofwords = review.split(" ");
        var ppos = 1.;
        var pneg = 1.;

        for (i = 0; i < bagofwords.length; i++) {
            ix = words.indexOf(bagofwords[i])
            if (ix != -1) {
                ppos = ppos*words_ppos[ix];
                pneg = pneg*(1.-words_ppos[ix]);
            }
        }
        ptot = ppos + pneg;
        ppos = ppos/ptot;
        pneg = pneg/ptot;

        var output_string = "P(positive|review text) = ";
        var prob_string = String(ppos);
        output_string = output_string.concat(prob_string);
        document.getElementById("calc").innerHTML = output_string;
    }
